import React, { Component } from 'react';
import './table.css';
class Table extends Component {

    constructor(props) {
        super(props);
        this.state = {
            status : [],
        }
    }


    componentDidMount() {
    // fetch('http://192.168.64.2/this.php',
    //     {
    //         method : 'post',
    //         body : JSON.stringify({
    //             start : 2,
    //             end : 5,
    //         })
    //     })
    //     .then(resp => resp.json())
    //     .then((data) => console.log(data));
    //         .catch(err => console.log(err));
    //     Axios.post('http://192.168.64.2/this.php', {
    //         start : this.props.start,
    //         end : this.props.end,
    //     }).then(resp => resp.json())
    //         .then(data=>console.log(data));
        fetch('http://192.168.64.2/this.php',
            {
                    method: "POST",
                    mode : "cors",
                    body : JSON.stringify({
                        start : this.props.start,
                        end : this.props.end,
                    })
                }
                )
            .then(data=> console.log(data))
            .catch(err => console.log(err));
    }

    componentDidUpdate(prevProps, prevState, snapshot) {
        console.log(this.state);
    }

    renderTableData()
    {
        return this.state.status.map((tab, index) => {
                const { row, cleanstatus, progress } = tab; //destructuring
                return (
                    <tr key={row}>
                        <td>{row}</td>
                        <td>{cleanstatus}</td>
                        <td>{progress}</td>
                    </tr>
                )
        })
    }

    renderTableHeader() {
        // console.log(this.props.tab);
        return (
            <tr>
                <th>Row</th>
                <th>Clean Status</th>
                <th>Progress</th>
            </tr>
        )
    }

    render() {
        return (
            <div>
                <h1 id='title'>Row Info</h1>
                <table id='RvZ'>
                    <tbody>
                    {this.renderTableHeader()}
                        {this.renderTableData()}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Table;
